class Interval
    attr_accessor :start, :end
    def initialize(s=0, e=0)
        @start = s
        @end = e
    end
end

def overlap?(start1, end1, start2, end2)
  !(start1 > end2 || start2 > end1)
end

def employee_free_time(avails)
  ret = []
  rett = []

  avails.each do |avail|
    avail.each do |interval|
      ret.push(interval)
    end
  end
  ret.sort! {|x,y| x.start<=>y.start}
  size = ret.size
  result = []
  result << ret[0]
  0.upto(size - 2) do |i|
    temp = result.pop
    if overlap?(temp.start, temp.end, ret[i + 1].start, ret[i + 1].end)
      result << Interval.new([temp.start,ret[i + 1].start].min, [ret[i + 1].end, temp.end].max)
    else
      result << temp << ret[i + 1]
    end
  end

  result.each_with_index do |interval, idx|
    next if idx == 0
    rett.push(Interval.new(result[idx - 1].end,interval.start))
  end
  rett
end
